var DigitalFlash=angular.module("DigitalFlash",["ngAnimate","DigitalFlashCtrls","DigitalFlashServices","LocalStorageModule"]);DigitalFlash.config(function(localStorageServiceProvider){localStorageServiceProvider.setPrefix("digitalFlash")});var DigitalFlashServices=angular.module("DigitalFlashServices",[]);DigitalFlashServices.factory("displayStacks",function(localStorageService){var stacks=[];return function(){for(var lskeys=localStorageService.keys(),arrayLength=lskeys.length,i=0;arrayLength>i;i++){var stackKey=localStorageService.get(lskeys[i]);stacks.push(stackKey)}return stacks}});